import { Layout } from './Layout';
import {Card} from './Card'
import './App.css';
import {Joke} from './Joke'
import jokesData from "./JokeData"
import stuffData from "./StuffData"

function App() {

const jokeElements=jokesData.map(joke=>{return<Joke setup={joke.theme} body={joke.joke} />})
const offer=stuffData.map(element=>{return <Card img={element.img} rate={element.rating} />})
  return (
    <div className="App">
      <Layout />
      <Card 
        img="/IMG/image1.jpg"
        motto="Być to mieć"
        price="160"
        rate="4.9"
        opinion="7"
        country="POL"
      />
      <Card 
        img="/IMG/mountain-bike.png"
        motto="Chciałbym byc marynarzem"
        price="210"
        rate="4.7"
        opinion="11"
        country="GER"
      />
      {jokeElements}
      {offer}

    </div>
  );
}

export default App;
